import { Morph } from "lively.morphic/morph.js";
import { connect, disconnectAll } from "lively.bindings/index.js";
import { debounce } from "lively.lang/function.js";

export default class UndoViewer extends Morph {
  static get properties (){
    return {
      target: {defaultValue: null,
              set(target) {
                this.setProperty("target", target);
              }},
      maxLength: {defaultValue: 100}
    }
  }
  onLoad() {
        this.getQueue(this.target)

        var propertyList = this.getSubmorphNamed('propertyList'),
          valueList = this.getSubmorphNamed('valueList'),
            self = this;             
        var reload = debounce(500,function(){              
              self.onLoad()
             if (propertyList.selection){
               self.filterFor(propertyList.selection)
             }
            })
        if (this.target){
          this.target.onChange = (change)=>{
            reload()
          }
        }

        disconnectAll(this)
        connect(propertyList,'onMouseUp',this,'updateValues',{converter: (obj)=>{
          var {source,target} = this.varMapping,
              selection = source.selection
            target.filterFor(selection)
        }})
        connect(valueList,'onMouseUp',this,'valueAction',{converter: (obj)=>{
          var {source,target} = this.varMapping,
              selection = source.selection
              return selection
              // target.valueAction(selection)
        }})
        if (this.undoQueue){
          propertyList.items = []
          var properties = ['all']
          this.undoQueue.forEach(function(ea){            
            if (properties.indexOf(ea.prop) == -1){
              properties.push(ea.prop)
            }
          })
          // console.log(properties)
          propertyList.items = properties
        }
  }

  getQueue(target){
    this.undoQueue = (target ? target.env.changeManager.changes.filter(function(ea){
      return ea.target == target
    }) : []).filter(function(obj){
      return (obj.value != obj.prevValue)
    }).slice(-1 * this.maxLength)

  }
  updateValues(aList){
    // alert(aList)
  }
  filterFor(property){
    var valueList = this.getSubmorphNamed('valueList')
    var items = this.undoQueue
    .filter(function(obj){

      return (obj.prop == property || property == 'all')
    }).map(function(obj){

      if (obj.type == 'setter'){
        if (obj.prevValue == null){
          obj.prevValue = 'null'
        }
        if (obj.value == null){
          obj.value = 'null'
        }

        var prev = obj.prevValue.toString ? obj.prevValue.toString() : JSON.stringify(obj.prevValue),
            next = obj.value.toString ? obj.value.toString() : JSON.stringify(obj.value),
            display = obj.prop + ' >> From: ' + prev + ' To: ' + next
    } else if (obj.type == 'method-call'){
      var method = obj.selector,
          targ = obj.target.toString ? obj.target.toString() : JSON.stringify(obj.target),
          display = method + ' on ' + targ
    }
      return {toString: function(){ return display},
             ...obj}
    })
    valueList.items = items    
    valueList.submorphs.forEach(function(ea){
      var onDragStart = function(evt){
        console.log('hit')
      }
      ea.onDragStart = onDragStart
    })
  }
  valueAction(obj){
    // console.log(obj)
  }
  beforePublish(){
    var propertyList = this.getSubmorphNamed('propertyList'),
        valueList = this.getSubmorphNamed('valueList')
    propertyList.items = []
    valueList.items = []
    this.undoQueue = []
    this.target = null
  }
}

